import { useState} from 'react';

function App(props) {

 let [count,setCount]=useState(0);

  function clickHandle() {
    setCount(++count);
  }

  return (
    <div>
      <div>{count}</div>
      <button onClick={clickHandle}>+1</button>
    </div>
  );
}

export default App;
